import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { Resume_model } from 'src/app/Models/Resume_model';
import { ResumeService } from 'src/app/Services/ResumeTaskServer';

@Component({
  selector: 'app-resume',
  templateUrl: './resume.component.html',
  styleUrls: ['./resume.component.css']
})
export class ResumeComponent implements OnInit {

  public ShowTaskListAray: Resume_model[] = [];
  private ActiveRoute: any;

  constructor(public s: ResumeService, public route: Router) { }

  async ngOnInit() {
    try
     {
      this.ShowTaskListAray = await this.s.ResumeSave();
     } 
    catch (ex: any) 
    {
      alert(ex.message);
    }
  }

  deleteItem()
  {
    this.ActiveRoute = this.route.url
    alert("To delete");
  }

}
